// src/components/DogPopup.js
import React from 'react';
import './DogPopup.css';

const DogPopup = ({ dog, onClose }) => {
  return (
    <div className="dog-popup">
      <div className="popup-content">
        <span className="close" onClick={onClose}>&times;</span>
        <h2>{dog.name}</h2>
        <p>Breed: {dog.breed}</p>
        <p>Price: ${dog.price}</p>
        <p>{dog.caption}</p>
        {/* Ajoutez d'autres informations sur le chien ici */}
      </div>
    </div>
  );
};

export default DogPopup;
